import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Row, Col} from 'react-bootstrap';
import { useParams } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import NavSc from '../componentes/navbar';
import Bootfooter from '../componentes/BSfooter';
import Card from 'react-bootstrap/Card';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import '../componentes/style.css';


function Salasmodficfunc() {
  
  const { id } = useParams();
  const [sala, setFormData] = useState([]);
  
  useEffect(() => {
      async function fetchFormData () {
      
      try {
        const response = await axios.get(`http://localhost:2527/api/fndfuncionarios/${id}`);
        setFormData(response.data);      
      } catch (error) {
        console.error(error);
      }
  
      };

      fetchFormData();
    },[id]); 

      const handleChange = (event) => {
        const {name, value} = event.target;
        setFormData({...sala, [name]: value});
      };
  return (    

    <Container fluid>

      <NavSc/>

      <Card>
      <Card.Body>
      <Row>
      <Col>
        <Form>
        <Form.Group as={Row} className="me-2" controlId="formBasicEmail">
          <Form.Label>CPF:</Form.Label>
          <Col sm={6}>
          <Form.Control type="text" placeholder="" value={sala.cpf} onChange={handleChange}/>
          </Col>
        </Form.Group>
        <Form.Group as={Row} className="me-2" controlId="formBasicPassword">
          <Form.Label>Nome:</Form.Label>
          <Col sm={6}>
          <Form.Control type="text" placeholder="" value={sala.nome} onChange={handleChange}/>
          </Col>
        </Form.Group>
        <Form.Group as={Row} className="me-2" controlId="formBasicPassword">
          <Form.Label>Cep:</Form.Label>
          <Col sm={6}>
          <Form.Control type="text" placeholder="" value={sala.cep} onChange={handleChange}/>
          </Col>
        </Form.Group>
        <Form.Group as={Row} className="me-2" controlId="formBasicPassword">
          <Form.Label>Email:</Form.Label>
          <Col sm={6}>
          <Form.Control type="text" placeholder="" value={sala.email} onChange={handleChange}/>
          </Col>
        </Form.Group>
        <Form.Group as={Row} className="me-2" controlId="formBasicPassword">
          <Form.Label>Telefone:</Form.Label>
          <Col sm={6}>
          <Form.Control type="text" placeholder="" value={sala.telefone} onChange={handleChange}/>
          </Col>
        </Form.Group>
        <Form.Group as={Row} className="me-2" controlId="formBasicPassword">
          <Form.Label>Função:</Form.Label>
          <Col sm={6}>
          <Form.Control type="text" placeholder="" value={sala.funcao} onChange={handleChange}/>
          </Col>
        </Form.Group>
        <Form.Group as={Row} className="me-2" controlId="formBasicCheckbox">
          <Col sm={6}>
          <Form.Check type="checkbox" label="Check me out" />
          </Col>
        </Form.Group>
        <Button variant="dark" size='lg' type="submit">
          SALVAR
        </Button>
        <Button variant="warning" size='lg' type="submit" href='../funcionarios'>
          CANCELAR
        </Button>
      </Form>
      </Col>
      </Row>
      </Card.Body>
      </Card>
      
      <Bootfooter/>

    </Container>
  );
}

export default Salasmodficfunc;
